        text:
          "The most comfortable and fast bicycle",
        image: Bicycle3,
        price: 1610,
      },
      {
        title: "Mountain bicycle FunnyTail",
        text:
          "Incredible feelings",
        image: Bicycle4,
        price: 1210,
      },

];
const MainCatalog = ()=>{
      const [cards,setCards] = useState(bicycles)

      return(
        <CardWrapper>
        {cards.map(({title,image,text,price},idx)=>(
            <CardItem 
              key={idx}
              title={title}
              text={text}
              image = {image}
              price={price}
              idx={idx}
            />
      ))}
      </CardWrapper>
      )

}

export default MainCatalog
